import React, { useState, useEffect } from 'react';
import Navigation from '../common/Navigation';
import UserManagement from './UserManagement';
import EquipmentManagement from './EquipmentManagement';
import ProcessRequests from './ProcessRequests';
import ReportsPage from './ReportsPage';
import { adminAPI } from '../../utils/api';
import { toast } from 'react-toastify';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const [activeSection, setActiveSection] = useState('dashboard');
  const [dashboardData, setDashboardData] = useState(null);
  const [loading, setLoading] = useState(true);

  const sections = [
    'dashboard',
    'userManagement',
    'equipmentManagement',
    'processRequests',
    'reports'
  ];

  useEffect(() => {
    if (activeSection === 'dashboard') {
      fetchDashboardData();
    }
  }, [activeSection]);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      const response = await adminAPI.getDashboardData();
      setDashboardData(response.data);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      toast.error('Failed to load dashboard data');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="admin-dashboard-wrapper">
      {/* Navigation with Logout */}
      <Navigation />

      <div className="admin-dashboard-container">
        <div className="dashboard-layout">
          {/* Sidebar Navigation */}
          <aside className="sidebar-navigation">
            <div className="sidebar-header">
              <h3>Menu</h3>
            </div>

            <nav className="sidebar-menu">
              {sections.map((section) => (
                <button
                  key={section}
                  className={`sidebar-menu-item ${activeSection === section ? 'active' : ''}`}
                  onClick={() => setActiveSection(section)}
                >
                  <span className="menu-text">
                    {section === 'dashboard' && 'üìä Dashboard'}
                    {section === 'userManagement' && 'üë• Users'}
                    {section === 'equipmentManagement' && 'üîß Equipment'}
                    {section === 'processRequests' && 'üìã Requests'}
                    {section === 'reports' && 'üìà Reports'}
                  </span>
                </button>
              ))}
            </nav>
          </aside>

          {/* Main Content */}
          <main className="dashboard-main-content">
            {/* Dashboard Section */}
            {activeSection === 'dashboard' && (
              <section className="dashboard-section">
                <div className="section-header">
                  <h2>Dashboard Overview</h2>
                  <p className="section-subtitle">Welcome back! Here's your system overview.</p>
                </div>

                {loading ? (
                  <div className="loading-container">
                    <div className="spinner"></div>
                    <p>Loading dashboard data...</p>
                  </div>
                ) : dashboardData ? (
                  <div className="dashboard-stats-grid">
                    <div className="stat-card">
                      <div className="stat-icon">üì¶</div>
                      <div className="stat-content">
                        <p className="stat-label">Total Equipment</p>
                        <p className="stat-value">{dashboardData.totalEquipment || 0}</p>
                      </div>
                    </div>

                    <div className="stat-card">
                      <div className="stat-icon">üë•</div>
                      <div className="stat-content">
                        <p className="stat-label">Active Users</p>
                        <p className="stat-value">{dashboardData.activeUsers || 0}</p>
                      </div>
                    </div>

                    <div className="stat-card">
                      <div className="stat-icon">‚è≥</div>
                      <div className="stat-content">
                        <p className="stat-label">Pending Requests</p>
                        <p className="stat-value">{dashboardData.pendingRequests || 0}</p>
                      </div>
                    </div>

                    <div className="stat-card">
                      <div className="stat-icon">‚úÖ</div>
                      <div className="stat-content">
                        <p className="stat-label">System Status</p>
                        <p className="stat-value">Operational</p>
                      </div>
                    </div>
                  </div>
                ) : (
                  <div className="error-container">
                    <p>Failed to load dashboard data</p>
                  </div>
                )}
              </section>
            )}

            {/* User Management Section */}
            {activeSection === 'userManagement' && (
              <section className="dashboard-section">
                <UserManagement />
              </section>
            )}

            {/* Equipment Management Section */}
            {activeSection === 'equipmentManagement' && (
              <section className="dashboard-section">
                <EquipmentManagement />
              </section>
            )}

            {/* Process Requests Section */}
            {activeSection === 'processRequests' && (
              <section className="dashboard-section">
                <ProcessRequests />
              </section>
            )}

            {/* Reports Section */}
            {activeSection === 'reports' && (
              <section className="dashboard-section">
                <ReportsPage />
              </section>
            )}
          </main>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
